function Show(props) {
  return <p>{props.title}</p>;
}

export async function getStaticProps({ params }) {
  return {
    props: params,
  };
}
export async function getStaticPaths() {
  const data = [
    {
      id: "1",
      title: "one",
    },
    {
      id: "2",
      title: "two",
    },
  ];
  const paths = data.map((posts, i) => {
    console.log(posts.title);
    return {
      params: {
        type: posts.id,
        title: posts.title,
      },
    };
  });

  return {
    paths,
    fallback: false,
  };
}

export default Show;
